import React from 'react';
import NavBar from './NavBar';
import Profile from './Profile';
import Stories from './Stories';
import Suggestions from './Suggestions';
import Posts from './Posts';
import { getHeaders } from './utils';

class App extends React.Component {  

    constructor(props) {
        super(props);
        this.state = {
            user: []
        }
        // constructor logic
        // console.log('NavBar component created');
        this.getUser();
    }

    render () {
        console.log("Rendering page, self is")
        console.log(this.state.user)
        return (
            <div>
                <NavBar title="Photo App" username={this.state.user ? this.state.user.username : "no user"}/>
                <aside>
                    <Profile />
                    <Suggestions />
                </aside>

                <main className="content">
                    <Stories />
                    <Posts />
                </main>
            </div>
        );
    }

    getUser(){
        fetch('/api/profile/', {
        method: "GET",
        headers: getHeaders()
    })
    .then(response => response.json())
    .then(data => {
        console.log("Fetching user self");
        console.log(data)
        this.setState({
            user: data
        })
    });
    }
}

export default App;
